import { AppBar, IconButton } from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import React from "react";

function Header() {
  return (
    <div className="header">
      <AppBar position="sticky">
        <IconButton
          edge="start"
          className="headerMenu"
          color="inherit"
          aria-label="menu"
        >
          <MenuIcon />
        </IconButton>
      </AppBar>
    </div>
  );
}

export default Header;
